import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import SaveUserData from './pages/SaveUserData'; // Save User Data page
import FetchUserData from './pages/FetchUserData'; // Fetch User Data page

function App() {
  return (
    <Router>
      <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif', maxWidth: '600px', margin: 'auto' }}>
        <nav style={{ marginBottom: '20px' }}>
          <Link to="/" style={{ marginRight: '10px', textDecoration: 'none', color: '#007bff' }}>
            Save Data
          </Link>
          <Link to="/fetch" style={{ textDecoration: 'none', color: '#007bff' }}>
            Fetch Data
          </Link>
        </nav>

        <Routes>
          <Route path="/" element={<SaveUserData />} />
          <Route path="/fetch" element={<FetchUserData />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
